Let me think through this step by step...

**Step 1: Key Psychological Mechanisms**

- **Fairness Sensitivity:** People are more likely to accept offers they perceive as fair relative to the contributions of each party. Here, the split percentages are not always interchangeable, since the pot size and total contributions differ.
- **Self-interest (Greed):** Participants are more likely to accept when their own gain is higher.
- **Inequity Aversion (Disadvantageous):** If a participant is offered less than the fair share (given their contributions), they may be less likely to accept.
- **Social Comparison / Contribution Norm:** Fair share may be determined by each person's contribution (“token_self” vs “token_opp”), possibly with some bias.
- **Tyranny of Number of Parameters:** To ensure parameter recovery, we should limit the number of learnable parameters, avoid high covariance, and pick orthogonal influences.

**Step 2: How Mechanisms Interact**

- **Self-Reward:** The monetary value of the offer (“split_self”) directly increases utility.
- **Relative Share:** The percentage given to the self compared to what would be “fair,” which may be calculated as: (token_self / [token_self + token_opp]).
- **Inequity aversion** may best be modeled as a penalty for deviation from the “contribution-based fair share”.

**Step 3: Mathematical Formulation**

- **Base Utility:** Positive effect of received amount.
- **Norm Violation Penalty:** Penalty for deviation from fair share (could use absolute difference).
- **Potential Softening:** Participants may be less sensitive to fairness violations in small stakes, or high stakes (possible, but for parsimony, ignore).

**Step 4: Parameters Needed**

- **Weight on self-money (beta_self):** Utility for what I get.
- **Weight on fairness (beta_fairness):** Sensitivity to (dis)advantageous inequity, i.e., difference from “contribution-based” share.
- **Decision Bias (intercept, bias):** General tendency to accept, unrelated to money or fairness.

Should we separate advantageous from disadvantageous inequity? For an initial model with strong parameter identifiability, use a single symmetric fairness parameter.

**Step 5: Model Formulation**

Let’s keep it simple:
- Compute the “contribution-based fair share” for self: fair_share_self = combined_earning * (token_self / (token_self + token_opp))
- Compute deviation: deviation = split_self - fair_share_self
- Utility: U = bias + beta_self * split_self - beta_fairness * abs(deviation)

If you wanted, you could do everything in percentages for parameter stability, but given the variable combined_earning, direct use of £ is transparent.

